// see https://github.com/videojs/video.js/pull/3856

render() {
    return (
      <div> 
        <div data-vjs-player>
          <video ref={node => (this.videoNode = node)} className="video-js vjs-big-play-centered" />
        </div>
      </div>
        );
    }
}

export default VideoPlayer;
